--
-- Structure for view `view_dailyrouting`
--
DROP TABLE IF EXISTS `view_dailyrouting`;

CREATE ALGORITHM=UNDEFINED DEFINER=`k2867255_tirta`@`localhost` SQL SECURITY DEFINER VIEW `view_dailyrouting` AS select (sum(`apiusagedaily`.`count`) / 30) AS `SUM(count)/30`,date_format(`apiusagedaily`.`date`,'%Y-%m') AS `mon` from `apiusagedaily` where (`apiusagedaily`.`type` = 'FINDROUTE') group by date_format(`apiusagedaily`.`date`,'%Y-%m');

